import React from "react";

import { Link } from "react-router-dom";

const Navbar = () =>{
    return(
        <>
            <div className="">
            <nav className="flex items-center bg-neutral-900 mr-0 justify-between">
                <div className="h-16 w-16">
                    <img src="/logo512.png" className="h-full w-full" />
                </div>
                <div className="flex gap-4">
                   <Link to ="/"><ul><span className="text-red-800">Home</span></ul></Link>
                   <Link to= "/about"><ul>About</ul></Link>
                   <ul>Function</ul>
                   <ul>Contact Us</ul>
                </div>
            </nav>
            </div>
        </>
    )
}

export default Navbar;
